import React from 'react';

const TrailSearchResult = (props) => (
   <div className="result">
      <div>{props.name}</div>
      <div>{props.property}</div>
      <div>{props.city}</div>
      <div>{props.state}</div>
   </div>
)

export default TrailSearchResult;
